import React, { useState } from 'react';

const ApplicationsPage = () => {
  const applications = [
    { id: 1, name: 'Application 1' },
    { id: 2, name: 'Application 2' },
    { id: 3, name: 'Application 3' },
    { id: 4, name: 'Application 4' },
    { id: 5, name: 'Application 5' },
  ];

  const [selectedApplication, setSelectedApplication] = useState(null);

  const handleApplicationClick = (application) => {
    setSelectedApplication(application);
  };

  return (
    <div>
      <h2 className="text-center">Data Alerts</h2>

      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
          </tr>
        </thead>
        <tbody>
          {applications.map((application) => (
            <tr key={application.id} onClick={() => handleApplicationClick(application)}>
              <td>{application.id}</td>
              <td>{application.name}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedApplication && (
        <div>
          <h3>Notifications for {selectedApplication.name}</h3>
          {/* Add your notification content for the selected application */}
        </div>
      )}
    </div>
  );
};

export default ApplicationsPage;
